import { connect } from 'react-redux'
import GameStats from '../components/GameStats'
import {
    updateTimer
} from '../Actions';

const mapDispatchToProps = dispatch => {
    return {
        clockTimer: x => {
            dispatch(updateTimer());
        },
    }
}
const GameStatFunction = connect(
    mapDispatchToProps
)(GameStats);

export default GameStatFunction
